import TodoItem from "./components/TodoItem"
import TodosData from './components/TodosData'


function App() {
  const TodoComponents = TodosData.map(item => <TodoItem key={item.id} item={item}/>)
  return (
    <div className="todo-list">
      {TodoComponents}
      {/* <TodoItem />
